import React from "react";
import AppLayout from "../components/AppLayout";
import GoalItem from "../components/GoalItem";

const Goal = () => {
  const goalList = [
    {
      id: 1,
      name: "런닝하기!",
      week: 2,
      day: 5,
    },
    { id: 2, name: "밥묵기!", week: 1, day: 2 },
    {
      id: 3,
      name: "수영하기!",
      week: 1,
      day: 1,
    },
  ];

  return (
    <AppLayout>
      {goalList &&
        goalList.map((goal) => {
          <div>{goal.name}</div>;
        })}
    </AppLayout>
  );
};

export default Goal;
